export interface IExtendedHeadCatalog {
    getHead(token: Token, species?: Species, headType?: HeadType): string;
    getSwatches(token: Token): Swatch[];
}

export const ReferenceHead = Head3;

class HeadCatalog {

    private rubberHeadCatalog: IExtendedHeadCatalog;

    private static _instance: HeadCatalog;

    swatches = [
        new Swatch(HeadType.AverageAngular, "Average Angular", (token) => HeadCatalog.decorateSwatch(Head1, token.skinColor), "HeadType.averageAngular"),
        new Swatch(HeadType.SquareJawed, "Square-Jawed Angular", (token) => HeadCatalog.decorateSwatch(Head2, token.skinColor), "HeadType.squareJawed"),
        new Swatch(HeadType.RoundedNarrow, "Rounded, Narrow", (token) => HeadCatalog.decorateSwatch(Head3, token.skinColor), "HeadType.roundedNarrow"),
        new Swatch(HeadType.RoundedAverage, "Rounded, Average", (token) => HeadCatalog.decorateSwatch(Head4, token.skinColor), "HeadType.roundedAverage"),
        new Swatch(HeadType.SofterNarrow, "Softer, Narrow Jaw", (token) => HeadCatalog.decorateSwatch(Head5, token.skinColor), "HeadType.softerNarrow"),
        new Swatch(HeadType.PointedDelicate, "Pointed, Delicate Jaw", (token) => HeadCatalog.decorateSwatch(Head6, token.skinColor), "HeadType.pointedDelicate"),
        new Swatch(HeadType.Rectangular, "Rectangular with Pointed Jaw", (token) => HeadCatalog.decorateSwatch(Head7RectangularFeminine, token.skinColor), "HeadType.rectangular"),
        new Swatch(HeadType.Elfin, "Elfin, Petite Jaw", (token) => HeadCatalog.decorateSwatch(Head8ElfinFeminine, token.skinColor), "HeadType.elfin"),
        new Swatch(HeadType.PillShaped, "Pill-Shaped, Heavy", (token) => HeadCatalog.decorateSwatch(Head9PillShaped, token.skinColor), "HeadType.pillShaped"),
        new Swatch(HeadType.RoundedHeavy, "Rounded, Heavy", (token) => HeadCatalog.decorateSwatch(Head10Round, token.skinColor), "HeadType.roundedHeavy"),
    ];

    public static get instance() {
        if (HeadCatalog._instance == null) {
            HeadCatalog._instance = new HeadCatalog();
        }
        return HeadCatalog._instance;
    }

    getHead(token: Token) {
        let result = "";
        switch (token.headType) {
            case HeadType.AverageAngular:
                result = Head1.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.SquareJawed:
                result = Head2.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.RoundedNarrow:
                result = Head3.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.RoundedAverage:
                result = Head4.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.SofterNarrow:
                result = Head5.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.PointedDelicate:
                result = Head6.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.Rectangular:
                result = Head7RectangularFeminine.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.Elfin:
                result = Head8ElfinFeminine.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.PillShaped:
                result = Head9PillShaped.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            case HeadType.RoundedHeavy:
                result = Head10Round.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                break;
            default:
        }
        if (token.species === Species.Trill) {
            return result + Trill.headOnly;
        } else if (token.species === Species.Andorian) {
            return result + AndorianForehead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else if (token.species === Species.Cardassian) {
            let chin = "";
            switch (token.headType) {
                case HeadType.RoundedNarrow:
                case HeadType.SofterNarrow:
                    chin = chin = CardassianChin.chin2;
                    break;
                case HeadType.PointedDelicate:
                case HeadType.Elfin:
                case HeadType.Rectangular:
                    chin = chin = CardassianChin.chin3;
                    break;
                case HeadType.AverageAngular:
                case HeadType.SquareJawed:
                case HeadType.RoundedAverage:
                case HeadType.PillShaped:
                case HeadType.RoundedHeavy:
                    chin = CardassianChin.chin1;
                    break;
                default:
            }
            return result + CardassianForehead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor) + chin;
        } else if (token.species === Species.Denobulan) {
            return result + DenobulanRidges.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else if (token.species === Species.Ferengi) {
            return result + FerengiForehead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor)
                + FerengiCheekAppliances.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else if (token.species === Species.Efrosian) {
            return result + EfrosianForehead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else if (token.species === Species.Romulan) {
            if (token.speciesOption === SpeciesOption.Option1) {
                return result + RomulanForehead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
            } else {
                return result;
            }
        } else if (token.species === Species.Bolian || token.species === Species.Benzite) {
            let chinSeam = Head1BolianSeamChin;
            switch (token.headType) {
                case HeadType.AverageAngular:
                    chinSeam = Head1BolianSeamChin;
                    break;
                case HeadType.SquareJawed:
                    chinSeam = Head2BolianSeamChin;
                    break;
                case HeadType.RoundedNarrow:
                    chinSeam = Head3BolianSeamChin;
                    break;
                case HeadType.RoundedAverage:
                    chinSeam = Head4BolianSeamChin;
                    break;
                case HeadType.SofterNarrow:
                    chinSeam = Head5BolianSeamChin;
                    break;
                case HeadType.PointedDelicate:
                    chinSeam = Head6BolianSeamChin;
                    break;
                case HeadType.Rectangular:
                    chinSeam = Head7BolianSeamChin;
                    break;
                case HeadType.Elfin:
                    chinSeam = Head8BolianSeamChin;
                    break;
                case HeadType.PillShaped:
                    chinSeam = Head9BolianSeamChin;
                    break;
                case HeadType.RoundedHeavy:
                    chinSeam = Head10BolianSeam;
                    break;
                default:
            }
            result += chinSeam.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor)
                + (token.speciesOption !== SpeciesOption.Option1 ? BolianStripes : "")
                + BolianSeam.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);

            if (token.species === Species.Benzite) {
                result += BenziteHead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor).replace(SpeciesRestrictions.DEFAULT_EYE_COLOR_REGEX, token.eyeColor);
            }

            return result;
        } else if (token.species === Species.Ktarian) {
            return result + KtarianHead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else if (token.species === Species.XindiPrimate) {
            return result
                + XindiPrimate.forehead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else if (token.species === Species.Tellarite) {
            return result + TellariteForehead;
        } else if (SpeciesRestrictions.isRubberHeaded(token.species) && this.isRubberHeadExtensionLoaded) {
            return this.rubberHeadCatalog.getHead(token);
        } else {
            return result;
        }
    }

    get isRubberHeadExtensionLoaded() {
        return this.rubberHeadCatalog != null;
    }

    loadRubberHeadExtension(completion: () => void = () => {}) {
        if (this.isRubberHeadExtensionLoaded) {
            completion();
        } else {
            import(/* webpackChunkName: 'rubberHead' */ './rubberHeadCatalog').then(({RubberHeadCatalog}) => {
                this.rubberHeadCatalog = new RubberHeadCatalog();
                completion();
            }).catch((error) => toast("Ooops. Something bad happened", { className: 'bg-danger' }));
        }
    }

    getSwatches(token: Token) {
        if (SpeciesRestrictions.isRubberHeaded(token.species) && this.isRubberHeadExtensionLoaded && token.species !== Species.Benzite) {
            return this.rubberHeadCatalog.getSwatches(token);
        } else {
            return this.swatches;
        }
    }

    static decorateSwatch(svg: string, skinColor: string) {
        let result = `<svg viewBox="0 0 275 275" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <g transform="translate(-135, 10)">`
            + SimpleNeck.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, skinColor)
            + svg.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, skinColor)
            + `</g>
            </svg>`;
        return result;
    }
}

export default HeadCatalog;